import { createRouter, createWebHistory } from 'vue-router'
import MainSilde from '../views/main/MainSilde.vue'
import TableTopMenu from '@/views/menu/TableTopMenu.vue'
import BoxList from '@/views/box/BoxList.vue'
import Phone from '@/views/phone/Phone.vue'
import Posting from '@/views/phone/Posting.vue'
import HandWriter from '@/views/handwriter/HandWriter.vue'
import ReceiptList from '@/views/receipt/ReceiptList.vue'
import ReceiptSelected from '@/views/receipt/ReceiptSelected.vue'
import Measurement from '@/views/measurement/Measurement.vue'
import ConfirmMeasurement from '@/views/measurement//ConfirmMeasurement.vue'
import IngMeasurement from '@/views/measurement//IngMeasurement.vue'
import ConfirmReceipt from '@/views/receipt/ConfirmReceipt.vue'
import ConfirmPayment from '@/views/payment/ConfirmPayment.vue'
import AddTag from '@/views/payment/AddTag.vue'
import PrintTag from '@/views/payment/PrintTag.vue'
import ReceiptNo from '@/views/receiptno/ReceiptNo.vue'

import Kiosk from '@/views/kiosk/Sender.vue'
import Easy from '@/views/easy/EasyMenu.vue'


const routes = [
  {
    path: '/',
    name: '/',
    component:MainSilde
  },
  {
    path : '/tabletopmenu',
    name : '/tabletopmenu',
    component : TableTopMenu
  },
  {
    path : '/boxlist',
    name : '/boxlist',
    component : BoxList
  },
  {
    path : '/phone',
    name : '/phone',
    component : Phone
  },
  {
    path : '/posting',
    name : '/posting',
    component : Posting
  },
  {
    path : '/handwriter',
    name : '/handwriter',
    component : HandWriter
  },
  {
    path : '/receiptlist',
    name : '/receiptlist',
    component : ReceiptList
  },
  {
    path : '/receiptselected',
    name : '/receiptselected',
    component : ReceiptSelected
  },
  {
    path : '/measurement',
    name : '/measurement',
    component : Measurement
  },
  {
    path : '/confirmmeasurement',
    name : '/confirmmeasurement',
    component : ConfirmMeasurement
  },
  {
    path : '/ingmeasurement',
    name : '/ingmeasurement',
    component : IngMeasurement
  },
  {
    path : '/confirmreceipt',
    name : '/confirmreceipt',
    component : ConfirmReceipt
  },
  {
    path : '/confirmpayment',
    name : '/confirmpayment',
    component : ConfirmPayment
  },
  {
    path : '/printtag',
    name : '/printtag',
    component : PrintTag
  },
  {
    path : '/addtag',
    name : '/addtag',
    component : AddTag
  },
  {
    path : '/receiptno',
    name : '/receiptno',
    component : ReceiptNo
  },
  {
    path : '/kiosk',
    name : '/kiosk',
    component : EasyMenu
  },
  {
    path : '/easymenu',
    name : '/easymenu',
    component : EasyMenu
  }

]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
